<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Document</title>
    <style type="text/css">
        .box {
            width: 980px;
            height: 600px;
            box-sizing: border-box;
        }

        a {
            text-decoration: none;
        }
        
        .content{
            display: flex;
        }

        .content__description{
            width: 280px;
            height: 575px;
            background: rgba(47, 50, 46, 1);
        }

        .content__description-logo{
            width: 179px;
            height: 150px;
            margin: 0 auto;
            margin-top: 97px;
        }

        .content__description-logo img{
            width: 100%;
            height: 100%;
            object-fit: cover;
        }

        .content__description-title{
            text-align: center;
            color: white;
            margin: 0;
            margin-top: 35px;
            font-size: 35px;
            line-height: 42px;
            font-family: "Minion Pro";
        }

        .content__description-subtitle{
            margin: 0;
            padding: 0;
            margin-top: -5px;
            text-align: center;
            color: white;
            letter-spacing: 0.2px;
            font-size: 16px;
            font-family: "Proxima Nova Rg";
            font-weight: 400;

        }

        .content__button{
            width: 207px;
            height: 37px;
            margin: 0 auto;
            border: 0.7px solid #FFFFFF;
            margin-top: 42px;
            font-size: 16px;
            letter-spacing: 0.2px;
            font-family: "Proxima Nova Rg";
            padding-top: 3px;
            box-sizing: border-box;
            color: white;
            text-align: center;

        }

        .content__image{
            width: 700px;
            height: 575px;
        }

        .content__image img{
            width: 100%;
            height: 100%;
            object-fit: cover;
        }

        .footer{
            width: 980px;
            height: 35px;
            background: #123C48;
            display: flex;
            justify-content: space-between;
            align-items: center;
            padding-left: 37px;
            padding-right: 37px;
            box-sizing: border-box;
        }

        .footer__image-1{
            width: 79px;
            height: 20px;
        }

        .footer__image-2{
            width: 143px;
            height: 25px;
        }

        .footer__image-1 img,
        .footer__image-2 img{
            width: 100%;
            height: 100%;
            object-fit: contain;
        }
